-- =============================================
-- Author:      Gartle LLC
-- Release:     10.0, 2022-07-05
-- Description: The procedure selects all requests
-- =============================================

CREATE PROCEDURE [s17].[usp_requests]
    @category_id int = NULL
    , @time_id int = NULL
    , @entity_id int = NULL
AS
BEGIN

SET NOCOUNT ON

SELECT
    r.category_id
    , r.time_id
    , r.entity_id
    , MAX(m1.name) AS category
    , MAX(m2.name) AS [time]
    , MAX(m3.name) AS entity
    , MAX(r.transaction_start_time) AS last_update
FROM
    s17.requests r
    INNER JOIN s17.categories m1 ON m1.id = r.category_id
    INNER JOIN s17.times m2 ON m2.id = r.time_id
    INNER JOIN s17.entities m3 ON m3.id = r.entity_id
WHERE
    r.category_id = COALESCE(@category_id, r.category_id)
    AND r.time_id = COALESCE(@time_id, r.time_id)
    AND r.entity_id = COALESCE(@entity_id, r.entity_id)
GROUP BY
    r.category_id
    , r.time_id
    , r.entity_id

END


