-- =============================================
-- Author:      Gartle LLC
-- Release:     10.0, 2022-07-05
-- Description: The procedure cleans the request data
-- =============================================

CREATE PROCEDURE [s17].[xl_actions_clean_requests]
    @category_id int = NULL
    , @time_id int = NULL
    , @entity_id int = NULL
    , @set_1_to_delete tinyint = NULL
AS
BEGIN

DECLARE @message nvarchar(max)

IF NOT COALESCE(@set_1_to_delete, 0) = 1
    BEGIN
    SET @message = 'Set 1 in the parameter to delete data'
    RAISERROR (@message, 11, 0)
    RETURN
    END

DELETE FROM s17.requests
WHERE
    category_id = @category_id
    AND [time_id] = @time_id
    AND [entity_id] = COALESCE(@entity_id, [entity_id])

END


GO

-- =============================================
-- Author:      Gartle LLC
-- Release:     10.0, 2022-07-05
-- Description: The procedure clones the request data
-- =============================================

CREATE PROCEDURE [s17].[xl_actions_clone_requests]
    @category_id int = NULL
    , @time_id int = NULL
    , @entity_id int = NULL
    , @target_category_id int = NULL
    , @target_time_id int = NULL
    , @target_entity_id int = NULL
    , @set_1_to_copy tinyint = NULL
AS
BEGIN

SET NOCOUNT ON

DECLARE @message nvarchar(max)

IF NOT COALESCE(@set_1_to_copy, 0) = 1
    BEGIN
    SET @message = 'Set 1 in the parameter to copy data'
    RAISERROR (@message, 11, 0)
    RETURN
    END

BEGIN TRANSACTION

BEGIN TRY

    INSERT INTO s17.requests
        ( entity_id
        , category_id
        , time_id
        , row_index
        , row_format
        , comment
        , account_id
        , subaccount_id
        , product_id
        , region_id
        , total
        , [01], [02], [03], [04], [05], [06], [07], [08], [09], [10], [11], [12]
        , row_formulas
        , transaction_start_time
        )
    SELECT
        COALESCE(@target_entity_id, f.entity_id)
        , @target_category_id
        , @target_time_id
        , row_index
        , row_format
        , comment
        , account_id
        , subaccount_id
        , product_id
        , region_id
        , total
        , [01], [02], [03], [04], [05], [06], [07], [08], [09], [10], [11], [12]
        , row_formulas
        , transaction_start_time
    FROM
        s17.requests f
    WHERE
        f.category_id = @category_id
        AND f.time_id = @time_id
        AND f.entity_id = COALESCE(@entity_id, f.entity_id)

END TRY

BEGIN CATCH
    SELECT @message = ERROR_MESSAGE()

    IF @@TRANCOUNT > 0
        ROLLBACK TRANSACTION

    RAISERROR (@message, 11, 0, @message)
    RETURN

END CATCH

IF @@TRANCOUNT > 0
    COMMIT TRANSACTION

END


